import './Home.css';
import Navbar from '../components/Navbar'
import bottomStyle from '../images/end-style.svg'

function Home() {
  return (
    <div className="home-container">
      <Navbar />
      <div className="home-info">
        <div>
            <h1>Study Buddies</h1>
        </div>
      </div>
      <div className="bottom-style">
        <img src={bottomStyle} />
      </div>
    </div>

  );
}

export default Home;
